uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- ASSETS ---
uniform sampler2D iChannel0; // Slot 0: Depth Map

// --- UNIFORMS ---
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;

// --- GEOMETRY CONTROLS ---
uniform float u_depth_strength;
uniform float u_face_zoom;
uniform float u_face_offset_y;
uniform float u_precision;      

// --- STYLE CONTROLS ---
uniform float u_smoothness;     
uniform float u_wireframe_mix;  
uniform float u_fog_density;
uniform float u_color_shift;
uniform float u_bloom_spread;

out vec4 fragColor;

// --- CONSTANTS ---
#define MAX_STEPS 128
#define MAX_DIST 30.0
#define SURF_DIST 0.002

// Color Utility: Cosine Palette
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d + iTime * u_color_shift * 0.1));
}

// Rotational helpers
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Background environment logic (Vibrant Data Stream)
float backSDF(vec3 p) {
    vec3 q = p;
    q.z -= iTime * u_speed * 0.8;
    q.xy *= rot(q.z * 0.05);

    // Create an infinite corridor of shapes
    vec3 id = floor(q/6.0);
    q = mod(q, 6.0) - 3.0;

    q.xy *= rot(iTime * 0.2 + id.z);

    float spheres = length(q) - 0.15;
    float bars = length(q.xz) - 0.01;
    float bars2 = length(q.yz) - 0.01;
    return min(spheres, min(bars, bars2));
}

// --- MAPPING ---
float map(vec3 p) {
    float time = iTime * u_speed;

    // 1. The Face/Canvas Shape
    float pDepth = (abs(u_depth_strength) < 0.001) ? 1.2 : u_depth_strength;
    float pZoom  = (abs(u_face_zoom) < 0.001)       ? 1.0 : u_face_zoom;
    float pOffY  = u_face_offset_y;

    // Base Box for the face
    float faceD = length(max(abs(p - vec3(0.0, pOffY, 0.0)) - vec3(1.2, 1.5, 0.05), 0.0)) - 0.02;

    // Texture Mapping onto the box
    vec3 p_mapped = p;
    p_mapped.y -= pOffY;
    vec2 uv = p_mapped.xy * vec2(pZoom, pZoom * 0.75) + vec2(0.5, 0.5);

    if (uv.x > 0.0 && uv.x < 1.0 && uv.y > 0.0 && uv.y < 1.0) {
        float h = texture(iChannel0, uv).r;
        if (h > 0.01) {
             float fade = smoothstep(0.0, 0.15, uv.x) * smoothstep(1.0, 0.85, uv.x) *
                          smoothstep(0.0, 0.15, uv.y) * smoothstep(1.0, 0.85, uv.y);
             faceD -= h * pDepth * fade;
        } else {
            faceD += 1.5; // Cutout background of image
        }
    } else {
        faceD += 1.5; 
    }

    // 2. The Environment 
    float envD = backSDF(p);

    // Combine
    return min(faceD, envD);
}

// --- SMOOTH NORMALS ---
vec3 getNormal(vec3 p) {
    float d = map(p);
    float smoothVal = (u_smoothness < 0.0001) ? 0.002 : u_smoothness;
    vec2 e = vec2(smoothVal, 0.0);
    return normalize(vec3(d - map(p - e.xyy), d - map(p - e.yxy), d - map(p - e.yyx)));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed;

    // Camera Setup
    vec3 ro = vec3(sin(time * 0.1) * 1.5, cos(time * 0.1) * 0.5, u_camera_dist);
    vec3 ta = vec3(0.0, u_face_offset_y, 0.0);
    vec3 fwd = normalize(ta - ro);
    vec3 side = normalize(cross(vec3(0,1,0), fwd));
    vec3 up = cross(fwd, side);
    vec3 rd = normalize(fwd * max(u_fov, 0.5) + uv.x * side + uv.y * up);

    // Raymarch
    float t = 0.0;
    float d = 0.0;
    int steps = 0;
    bool hit = false;
    float stepMult = mix(0.2, 0.9, u_precision);

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * t;
        d = map(p);
        if(d < SURF_DIST) { hit = true; break; }
        if(t > MAX_DIST) break;
        t += d * stepMult; 
        steps++;
    }

    vec3 col = vec3(0.0);

    // Dynamic Sky Color
    vec3 skyBase = palette(rd.y * 0.5 + 0.5);
    vec3 skyCol = skyBase * (0.05 + 0.05 * sin(time + rd.y * 5.0));

    if(hit) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        float diff = clamp(dot(n, normalize(vec3(1,2,3))), 0.0, 1.0);
        float spec = pow(max(dot(ref, -rd), 0.0), 16.0);
        float rim = pow(1.0 + dot(rd, n), 4.0);

        // Determine if we hit the face or the environment
        float pZoom  = (abs(u_face_zoom) < 0.001) ? 1.0 : u_face_zoom;
        vec2 mapUV = (p.xy - vec2(0.0, u_face_offset_y)) * vec2(pZoom, pZoom * 0.75) + vec2(0.5, 0.5);
        bool isFace = (mapUV.x > 0.0 && mapUV.x < 1.0 && mapUV.y > 0.0 && mapUV.y < 1.0);

        if (isFace && t < 15.0) {
            float h = texture(iChannel0, mapUV).r;
            vec3 faceCol = palette(h + p.z * 0.2);

            vec3 solid = faceCol * (diff + 0.2) + vec3(spec * 0.5) + (rim * faceCol);

            // Wireframe Overlay
            float grid = smoothstep(0.02, 0.0, abs(sin(p.x * 40.0) * sin(p.y * 40.0)));
            vec3 wireCol = palette(p.z * 0.5) * 3.0 * grid;

            col = mix(solid, wireCol, u_wireframe_mix);
            col += h * u_glow_intensity * faceCol;
        } else {
            // ENVIRONMENT RENDERING
            vec3 envCol = palette(p.z * 0.1);
            col = envCol * (diff * 0.5 + rim * 0.5);
            col += vec3(spec);
        }

        // Volumetric step glow
        col += float(steps) * 0.0015 * palette(t * 0.1);
    } else {
        col = skyCol;
        // Background Stars/Glimmer
        float stars = pow(fract(sin(dot(rd, vec3(12.9898, 78.233, 45.164))) * 43758.5453), 40.0);
        col += palette(rd.z) * stars * 2.0;
    }

    // Atmospheric Fog
    float fog = 1.0 - exp(-t * u_fog_density);
    col = mix(col, skyCol, fog);

    // Bloom/Glow expansion
    col += u_bloom_spread * palette(iTime * 0.1) * (1.0 / (1.0 + t*t*0.1)) * u_glow_intensity;

    // Post-processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.1; // Contrast

    // Subtle Saturation Boost
    float luma = dot(col, vec3(0.299, 0.587, 0.114));
    col = mix(vec3(luma), col, 1.2); 

    fragColor = vec4(col, 1.0);
}
